    <GridItem colSpan={3}>
      <Heading> The Classical Maya </Heading>
      <Stack direction='row' spacing={3} p={6}>
        <AspectCard />
        {/* <AspectCard /> */}
      </Stack>
      {/* <Stack direction='row' spacing={3} p={6}>
        <AspectCard />
        <AspectCard />
      </Stack> */}
    </GridItem>
  )
}

export default Homepage
